
/* SELECT 
  'GO 
 IF NOT EXISTS(SELECT * FROM JscFieldDesigns WHERE ID = '''+CONVERT(VARCHAR(50),design.id)+''' ) 
  BEGIN 
  INSERT INTO JscFieldDesigns (
	  Id,
	  TableDesign,
	  FieldName,
	  Sequence,
	  DataType,
	  Length,
	  FieldClass,
	  FieldOption,
	  Enabled)
  VALUES(
'''+CONVERT(VARCHAR(50),design.id)+''',
'''+CONVERT(VARCHAR(50),TableDesign)+''',
'''+FieldName+''',
'''+CONVERT(VARCHAR(50), Sequence)+''',
'''+CONVERT(VARCHAR(50), DataType)+''',
'+ CASE When Length IS not null then ''''+ CONVERT(VARCHAR(50),Length)+'''' else 'NULL' END +',
'''+CONVERT(VARCHAR(50), FieldClass)+''',
'+ CASE When FieldOption IS not null then ''''+CONVERT(VARCHAR(50),FieldOption)+'''' else 'NULL' END +',
' + CONVERT(VARCHAR, Enabled)+')

	END
ELSE
	Begin
		Update  JscFieldDesigns set
			TableDesign='''+CONVERT(VARCHAR(50), TableDesign)+''',
		    FieldName='''+FieldName+''',
		    Sequence='''+CONVERT(VARCHAR(50), Sequence)+''',
		    DataType='''+CONVERT(VARCHAR(50), DataType)+''',
		    Length='+ CASE When Length IS not null then ''''+CONVERT(VARCHAR(50),Length) +'''' else 'NULL' END +',
		    FieldClass='''+CONVERT(VARCHAR(50), FieldClass)+''',
			FieldOption='+ CASE When FieldOption IS not null then ''''+CONVERT(VARCHAR(50),FieldOption)+'''' else 'NULL' END +',
		    Enabled='''+CONVERT(VARCHAR(50), Enabled)+'''
		WHERE ID = '''+CONVERT(VARCHAR(50),design.id)+'''
	END'
  FROM (
  
  SELECT 
	  Id,
	  TableDesign,
	  FieldName,
	  Sequence,
	  DataType,
	  Length,
	  FieldClass,
	  FieldOption,
  Enabled
  FROM JscFieldDesigns --where ID = 'F8238AF6-1019-4179-A1BC-0213037D4AAA'
  ) design
  */

